import React from "react"

export default class TelaListaUsuario extends React.Component {

    pegarUsu


    render() {
        return(
            <div>                       
              <p>Tela Lista de Usuários</p>
              <button onClick={this.props.irParaCadastro}>Ir para Cadastro</button> 
              <h2>Lista de Usuários</h2> 
            </div>
        )
    }
}
